import React from "react";

import { PetPlacesProvider } from "./PlacesContext";

import DataTable from "./DataTable/DataTables";

// import { Link } from "react-router-dom";

//Import Breadcrumb
import Breadcrumbs from "../../components/Common/Breadcrumb";

import "./PetPlaces.scss";

// Table data

const PetPlaces = () => {
  const errorStyles = {
    borderColor: "red",
  };
  // const [addNew, setAddNew] = useContext(PlacesContext);

  return (
    <PetPlacesProvider>
      <React.Fragment>
        <div className="page-content">
          <div className="container-fluid">
            <Breadcrumbs title="Pet Places" />
            <DataTable />
          </div>
        </div>
      </React.Fragment>
    </PetPlacesProvider>
  );
};

export default PetPlaces;
